import React from "react";
import "../styles/Contact.css";

export default function Contact() {
	return (
		<section id="contact" className="contact">
			<h2>Contact Us</h2>
			<p>For enquiries, email us at <a href="mailto:hello@intellibridge.com">hello@intellibridge.com</a></p>
		</section>
	);
}
